import React, { Component } from 'react'
import { Link } from 'react-router-dom'


export class SignIn extends Component {


    constructor(props) {
        super(props);
        this.state = {
            user_email : "",
            password : ""
        }
    }

    render() {

        const {user_email, user_pass} = this.state;

        return (
            <div className="wrapper fadeInDown">
                <div id="formContent">
                    <h2 className="active signh2" > Sign In </h2>

                    <div className="fadeIn first">
                        <i className="fa-solid fa-user fa-6x mb-2 mt-2"></i>
                    </div>

                    <form name="signiF" action="" method="GET" onSubmit={this.handleSubmit}>
                        <input type="email" id="email" className="fadeIn second" name="user_email" placeholder="Email adress" value={user_email} onChange={this.handleChange} />
                        <input type="password" id="password" className="fadeIn third" name="user_pass" placeholder="password" value={user_pass} onChange={this.handleChange} />
                        <input type="submit" className="fadeIn fourth" value="Log In" />
                    </form>

                    <div id="formFooter">
                        <Link className="underlineHover" to="/forget-password">Forgot Password?</Link>
                        <br />
                        <Link className="underlineHover" to="/rigister">Create an account ?</Link>
                    </div>
                </div>
            </div>
        )
    }


    handleChange = event => {
        this.state({
            [event.target.name] : event.target.value
        });
    }

    handleSubmit = event => {
        console.log("Submitting");
        console.log(this.state);
    }
}

export default SignIn
